tables.table_schema:
CREATE TABLE CustomerFeedback (
  feedback_id INT PRIMARY KEY,
  customer_id INT,
  feedback_text VARCHAR,
  rating INT
);

CREATE TABLE ReviewAnalysis (
  analysis_id INT PRIMARY KEY,
  feedback_id INT,
  sentiment_score FLOAT,
  keywords TEXT
);

CREATE TABLE ServiceImprovements (
  improvement_id INT PRIMARY KEY,
  feedback_id INT,
  improvement_description TEXT
);

CREATE TABLE FeedbackInsights (
  insight_id INT PRIMARY KEY,
  feedback_id INT,
  insight_text TEXT
);

CREATE TABLE CustomerRating (
  rating_id INT PRIMARY KEY,
  customer_id INT,
  overall_rating FLOAT,
  specific_rating FLOAT
);
